Method.Source:
    [Form]
    public class AssetComponentList_JP extends FormRun
    {
        InventDimCtrl_Frm_Component_JP  inventDimFrmComp;
        InventDimCtrl_Frm_Component_JP  inventDimFrmCompDis;
        AssetTable                      assetTable;
        AssetBook                       assetBook;
        boolean                         enabled;

}

public void init()
{
    if (element.args().dataset() == tableNum(AssetTable))
    {
        assetTable = element.args().record();
        assetBook = AssetBook::find(assetTable.AssetId, AssetComponent_JP::getAssemblingAssetBookId(assetTable.AssetId));
    }

    if (!assetTable || ! assetBook)
    {
        throw error(error::wrongUseOfFunction(funcName()));
    }

    super();

    element.updateDesign(InventDimFormDesignUpdate::Init);
    element.initEnable();
}

public void initEnable()
{
    if (AssetComponent_JP::isAssemblingEnabled()
        && (assetBook.Status    == AssetStatus::Open
            || assetBook.Status == AssetStatus::NoAcquisition))
    {
        enabled = true;
    }
    AssetComponent_JP_ds.allowCreate(enabled);
    AssetComponent_JP_ds.allowDelete(enabled);
    AssetComponent_JP_ds.allowEdit(enabled);
    AssetComponentAddToDisassemble_JP.enabled(enabled);
    PurchCopyAllHeader.enabled(enabled);

    AssetComponentDisassembling_ds.allowCreate(enabled);
    AssetComponentDisassembling_ds.allowDelete(enabled);
    AssetComponentDisassembling_ds.allowEdit(enabled);
}

Object inventDimSetupObject()
{
    if (this.selectedControl().name() == DisfInventDimParmFixedComp.name())
    {
        return inventDimFrmCompDis;
    }
    else
    {
        return inventDimFrmComp;
    }
}

void updateDesign(InventDimFormDesignUpdate _mode,
                  IdentifierName            _dsName = '')
{
    Set             set;
    Set             setDis;

    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init        :
            if (!inventDimFrmComp)
            {
                set = new Set(Types::String);
                set.add(InventDimComponent_ds.name());
                inventDimFrmComp = InventDimCtrl_Frm_Component_JP::newFromFormValidDataSources(element, set);
            }
            if (!inventDimFrmCompDis)
            {
                setDis = new Set(Types::String);
                setDis.add(InventDimComponentDisassembling_ds.name());
                inventDimFrmCompDis = InventDimCtrl_Frm_Component_JP::newFromFormValidDataSources(element, setDis);
            }
        // No break
        case InventDimFormDesignUpdate::Active      :
            switch (_dsName)
            {
                case assetComponent_JP_ds.name():
                    inventDimFrmComp.formActiveSetup(InventDimGroupSetup::newItemId(assetComponent_JP.ItemId));
                    inventDimFrmComp.formSetControls(true);
                    break;

                case AssetComponentDisassembling_ds.name():
                    inventDimFrmCompDis.formActiveSetup(InventDimGroupSetup::newItemId(AssetComponentDisassembling.ItemId));
                    inventDimFrmCompDis.formSetControls(true);

                default:
                    inventDimFrmComp.formSetControls(true);
                    inventDimFrmCompDis.formSetControls(true);
            }
            break;
        case InventDimFormDesignUpdate::FieldChange :
            switch (_dsName)
            {
                case assetComponent_JP_ds.name():
                    inventDimFrmComp.formActiveSetup(InventDimGroupSetup::newItemId(assetComponent_JP.ItemId));
                    inventDimFrmComp.formSetControls(false);
                    break;

                case AssetComponentDisassembling_ds.name():
                    inventDimFrmCompDis.formActiveSetup(InventDimGroupSetup::newItemId(AssetComponentDisassembling.ItemId));
                    inventDimFrmCompDis.formSetControls(false);
                    break;
            }
            break;

        default :
            throw error(strFmt("@SYS54195", funcName()));
    }
}

public boolean validateWrite()
{
    boolean ret;

    ret = super();

    if (ret)
    {
        ret = InventMovement::setAutoReserving(AssetComponent_JP);
    }

    return ret;
}

public int active()
{
    int ret;

    ret = super();
    if (ret)
    {
        element.updateDesign(InventDimFormDesignUpdate::Active, this.name());
        element.updateEnable();
        inventDimComponent_ds.active();
    }
    return ret;
}

public void write()
{
    AssetComponent_JP.InventDimId = InventDim::findOrCreate(InventDimComponent).InventDimId;
    super();
    if (AssetComponent_JP.InventDimId != InventDimComponent.InventDimId)
    {
        InventDimComponent.data(InventDim::find(AssetComponent_JP.InventDimId));
        inventDimComponent_ds.setCurrent();
    }
}

public void modified()
{
    super();
    AssetComponent_JP.initFromInventTable(InventTable::find(AssetComponent_JP.ItemId), true);
    element.updateDesign(InventDimFormDesignUpdate::FieldChange, AssetComponent_JP_ds.name());
}

public void delete()
{
    boolean isQtyChanged;

    if (AssetComponentDisassembling.ComponentRefRecId)
    {
        isQtyChanged = true;
    }

    super();
    if (isQtyChanged)
    {
        AssetComponent_JP_ds.research();
    }
}

public void write()
{
    boolean isQtyChanged;
    AssetComponentDisassembling.InventDimId = InventDim::findOrCreate(InventDimComponentDisassembling).InventDimId;
    if (AssetComponentDisassembling.ComponentRefRecId
        && AssetComponentDisassembling.orig().Qty != AssetComponentDisassembling.Qty)
    {
        isQtyChanged = true;
    }

    super();
    if (AssetComponentDisassembling.InventDimId != InventDimComponentDisassembling.InventDimId)
    {
        InventDimComponentDisassembling.data(InventDim::find(AssetComponentDisassembling.InventDimId));
        InventDimComponentDisassembling_ds.setCurrent();
    }

    if (isQtyChanged)
    {
        AssetComponent_JP_ds.research();
    }
}

public int active()
{
    int ret;

    ret = super();
    if (ret)
    {
        element.updateDesign(InventDimFormDesignUpdate::Active, this.name());
        element.updateEnable();
        inventDimComponentDisassembling_ds.active();
    }
    return ret;
}

public void modified()
{
    RefRecId            assetCompoentRecId;
    AssetComponent_JP   assetComponentAssembling;

    super();

    assetCompoentRecId = AssetComponent_JP::findFirstAvailableAssemblingEntry(
        AssetComponentDisassembling.AssetId,
        AssetComponentDisassembling.ItemId);
    if (assetCompoentRecId)
    {
        ttsBegin;
        assetComponentAssembling = AssetComponent_JP::find(assetCompoentRecId);
        AssetComponentDisassembling.initFromAssetComponent(assetComponentAssembling);
        AssetComponentDisassembling.Qty = assetComponentAssembling.availableScrapQty();
        InventDimComponentDisassembling.data(InventDim::find(AssetComponentDisassembling.InventDimId));
        InventDimComponentDisassembling_ds.setCurrent();
        AssetComponentDisassembling_ds.write();

        AssetComponentAddToDisassemble_JP::addDisassemble(
            assetCompoentRecId,
            AssetComponentDisassembling.RecId,
            assetComponentAssembling.availableScrapQty());
        ttsCommit;

        AssetComponent_JP_ds.research();
    }
    else
    {
        AssetComponentDisassembling.initFromInventTable(InventTable::find(AssetComponentDisassembling.ItemId), true);
        element.updateDesign(InventDimFormDesignUpdate::FieldChange, AssetComponentDisassembling_ds.name());
    }
}

void clicked()
{
    MenuFunction        menuFunction;
    Args                args;

    args = new Args();
    args.record(assetTable);
    args.parmEnumType(enumNum(SalesPurchCopy));
    args.parmEnum(SalesPurchCopy::CopyAllHeader);
    args.caller(element);

    menuFunction = new MenuFunction(menuitemDisplayStr(AssetComponentAddFromPurchOrder_JP), MenuItemType::Display);
    if (menuFunction && menuFunction.checkAccessRights())
    {
        menuFunction.run(args);
    }
}
